import React from "react";
// import InputCustom from "./components/hooks/InputCustom";
// import HookTimerUsingRef from "./components/hooks/HookTimerUsingRef";
// import UseRefHook from "./components/hooks/UseRefHook";
// import UseMemoHook from "./components/hooks/UseMemoHook";
// import ParentCompo from "./components/hooks/ParentCompo";
// import FetchDataUseReducer from "./components/hooks/FetchDataUseReducer";
// import MainCompo from "./components/hooks/MainCompo";
// import UseReducerTwoCounter from "./components/hooks/UseReducerTwoCounter";
// import UseReducerCounter from "./components/hooks/UseReducerCounter";
// import CompoHookA from "./components/hooks/CompoHookA";
// import HookFetchData from "./components/hooks/HookFetchData";
// import IntervalHookCounter from "./components/hooks/IntervalHookCounter";
// import HookMouseContainer from "./components/hooks/HookMouseContainer";
// import HookMouse from "./components/hooks/HookMouse";
// import UseEffectHook from "./components/hooks/UseEffectHook";
// import HookArray from "./components/hooks/HookArray";
// import HookCounter from "./components/hooks/HookCounter";
// import HookObj from "./components/hooks/HookObj";
// import CompoA from "./components/context/CompoA";
// import CompoE2way from "./components/context/CompoE2way";
// import Portals from './components/Portals';
// import InLineStyle from './components/InLineStyle';
// import Style from './components/Style';
// import StyleMoudle from './components/StyleMoudle';
// import NameList from './components/NameList';
// import Refs from './components/Refs';
// import ClickCount from './components/ClickCount';
// import HoverCount from './components/HoverCount';
// import HoverCountProps from "./components/HoverCountProps";
// import ClickCountProps from "./components/ClickCountProps";
// import PropsRender from "./components/PropsRender";
// -------------------------- Rect Router --------------------------
import { Routes, Route } from "react-router-dom";
import "./css/style.css";
import Home from "./routers/Home";
import NavBar from "./routers/NavBar";
import OrderInfo from "./routers/OrderInfo";
import Product from "./routers/Product";
import Featured from "./routers/Featured";
import New from "./routers/New";
import NoMatch from "./routers/NoMatch";
import Users from "./routers/Users";
import UserDetails from "./routers/UserDetails";
import Admin from "./routers/Admin";
import Profile from "./routers/Profile";
import { AuthProvider } from "./routers/auth";
import Login from "./routers/Login";
import RequireAuth from "./routers/RequireAuth";
// I Will Test Lazy Load For This Page To Improve Performance--------
// import About from "./routers/About";
const LazyAbout = React.lazy(() => import("./routers/About"));
// Lazy Load End ------------------------------

function App() {
  return (
    // Using Authentication
    <AuthProvider>
      {/* Some Tests Here... */}
      <div>
        {/* For Sharing Code Using Props Render  */}
        {/* <PropsRender render={(count, incrementCount) => <HoverCountProps count={count} incrementCount={incrementCount} />} />
      <PropsRender render={(count, incrementCount) => <ClickCountProps count={count} incrementCount={incrementCount} />} /> */}
      </div>
      <NavBar />
      <Routes>
        <Route path="/" element={<Home />} />
        {/* React Supense Is fall Back UI Component To Show It When Download The Lazy Load Page. */}
        {/* <Route path="about" element={<About/>} /> */}
        <Route
          path="about"
          element={
            <React.Suspense fallback="Loading...">
              <LazyAbout />
            </React.Suspense>
          }
        />
        {/* ------------------------------------------------------------- */}
        <Route path="order-info" element={<OrderInfo />} />
        <Route path="order-info" element={<OrderInfo />} />
        <Route path="product" element={<Product />}>
          <Route index element={<Featured />} />
          <Route path="featured" element={<Featured />} />
          <Route path="new" element={<New />} />
        </Route>
        <Route path="users" element={<Users />}>
          <Route path=":userID" element={<UserDetails />} />
          <Route path="admin" element={<Admin />} />
        </Route>
        <Route path="profile" element={<RequireAuth><Profile/></RequireAuth>} />
        <Route path="login" element={<Login />} />
        <Route path="*" element={<NoMatch />} />
      </Routes>
    </AuthProvider>
  );
}

export default App;
